import React, {Component} from 'react';
import {Card} from "antd";
import blockStyle from './index.module.css';
import cover from '../../images/cover.jpg';
const {Meta}=Card;

class Block extends Component {
    render() {
        return (
            <Card className={blockStyle.card} cover={<img src={cover}/>}>
                <Meta title='言职区'>

                </Meta>
            </Card>
        );
    }
}

export default Block;
